import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import logo from "./images/food.jpeg"
import foodimg from "./images/res1.jpeg"


const resList = [
    {
       name : "KFC",
       rating : "4.1",
       deliveryTime : "35 minutes",
       foodImg : {foodimg},
       id : 1
    },
    {
        name : "Insta mart",
        rating : "4.5",
        deliveryTime : "35 minutes",
        id : 2
    },
    {
        name : "MBA CHAI WALA",
        rating : "4.8",
        deliveryTime : "35 minutes",
        id : 3
       
    },
    {
        name : "RAGHU KI CHAI",
        rating : "3.2",
        deliveryTime : "35 minutes",
        id : 4
    },
    {
        name : "FUN & TEA",
        rating : "4.1",
        deliveryTime : "35 minutes",
        id : 5
    },
    {
        name : "FUN & TEA",
        rating : "4.1",
        deliveryTime : "35 minutes",
        id : 6
    },
    {
        name : "FUN & TEA",
        rating : "4.1",
        deliveryTime : "35 minutes",
        id : 7
    },{
        name : "FUN & TEA",
        rating : "4.1",
        deliveryTime : "35 minutes",
        id : 8
    },{
        name : "FUN & TEA",
        rating : "4.1",
        deliveryTime : "35 minutes",
        id : 9
    }
]
const Header = () =>(
    <div className="header">
        <div className="logo-container">
            <img src={logo} />
        </div>
        <div className="nav-items">
            <ul>Home</ul>
            <ul>About us</ul>
            <ul>contact us</ul>
        </div>
    </div>
);

const resobj = {
    "info": {
                      "id": "234875",
                      "name": "Adil Hotel",
                      "cloudinaryImageId": "gp1ityra6utvzqn6ghnv",
                      "locality": "Rautha Wada",
                      "areaName": "Chhindwara Locality",
                      "costForTwo": "₹150 for two",
                      "cuisines": [
                        "North Indian",
                        "Biryani",
                        "Tandoor"
                      ],
                      "avgRating": 4.3,
                      "parentId": "27123",
                      "avgRatingString": "4.3",
                      "totalRatingsString": "1.0K+",
                      "sla": {
                        "deliveryTime": 43,
                        "lastMileTravel": 10.8,
                        "serviceability": "SERVICEABLE",
                        "slaString": "40-45 mins",
                        "lastMileTravelString": "10.8 km",
                        "iconType": "ICON_TYPE_EMPTY"
                      },
                      "availability": {
                        "nextCloseTime": "2024-11-25 23:00:00",
                        "opened": true
                      },
                      "badges": {
                        
                      },
                      "isOpen": true,
                      "type": "F",
                      "badgesV2": {
                        "entityBadges": {
                          "imageBased": {
                            
                          },
                          "textBased": {
                            
                          },
                          "textExtendedBadges": {
                            
                          }
                        }
                      },
                      "aggregatedDiscountInfoV3": {
                        "header": "₹150 OFF",
                        "subHeader": "ABOVE ₹349",
                        "discountTag": "FLAT DEAL"
                      },
                      "differentiatedUi": {
                        "displayType": "ADS_UI_DISPLAY_TYPE_ENUM_DEFAULT",
                        "differentiatedUiMediaDetails": {
                          "lottie": {
                            
                          },
                          "video": {
                            
                          }
                        }
                      },
                      "reviewsSummary": {
                        
                      },
                      "displayType": "RESTAURANT_DISPLAY_TYPE_DEFAULT",
                      "restaurantOfferPresentationInfo": {
                        
                      },
                      "externalRatings": {
                        "aggregatedRating": {
                          "rating": "--"
                        }
                      },
                      "ratingsDisplayPreference": "RATINGS_DISPLAY_PREFERENCE_SHOW_SWIGGY"
                    },
                    "analytics": {
                      "context": "seo-data-d79d0efb-1d90-4d17-a6b8-0f1fefaa8da9"
                    },
                    "cta": {
                      "link": "https://www.swiggy.com/city/chhindwara/adil-hotel-rautha-wada-chhindwara-locality-rest234875",
                      "type": "WEBLINK"
                    }
                  }

const ResCard = (props) =>{
    // console.log(props);
   const {resData} = props;
       return (
        <div className="res-card" >
            <img src={logo} style={{width:"100%"}}></img>
            <h4>{resData.name}</h4>
            <h5>Rating . {resData.rating}</h5>
            <h5>Delivery Time . {resData.deliveryTime}</h5>
            {/* <img src={logo} style={{width:"100%"}}></img>
            <h4>{resData.info.name}</h4>
            <h5>Rating . {resData.rating}</h5>
            <h5>Delivery Time . {resData.deliveryTime}</h5> */}
        </div>
    );
}


const Body = () =>{
   return (
    <div className="body">
    <h3>serach</h3>
    <div className="res-container">
        {
            resList.map((res)=>{
               return <ResCard key={res.id} resData={res} />
            }
        )
        }
    </div>
    </div>
)
}


const AppLayout = () =>(
     <>
     <Header />
     <Body />
     </>
)
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<AppLayout />);
